import dataM from '../data/gogungCategory.json';
import dataD from '../data/gogungListOpenApi.json';
import search_black_24dp from '../img/search_black_24dp.svg';

import { useState, useEffect } from "react";

function Search(){
    let [search, setSearch] = useState([]);
    let [filter, setFilter] = useState(dataM, dataD);
    // 랜덤 숫자
    let img = Math.floor(Math.random()*5);

    function letmesearch(e){
        let value = e.target.value.toLowerCase();
        console.log(value);
        search = dataD.list.filter((data) => {
        return data.contents_kor.search(value) != -1;
        });
        setSearch(search);
    }

    return(
        <>
            <div className="search">
                <img src={dataM.gogung[img].imgUrl} alt=""/>
                <form>
                    <span><img src={search_black_24dp} alt=""/></span>
                    <input type="text" placeholder="오늘은 고궁에 가볼까?" 
                        onChange={(e)=>letmesearch(e)} 
                    />
                </form>
            </div>
            <div className='result'>
                
            </div>
        </>
    );
}
export default Search;
